import { Question } from "./components/Question.js";
import { QuestionNavbar } from "../QuestionNavbar.js";

export const Study7 = () => {
  return (
    <div className="questions">
      <QuestionNavbar />
      <Question
        title={
          "Miten haet tietoa mielipiteitä jakavasta aiheesta?​​"
        }
        options={[
          { value: "Käytän auktorisoituja ja virallisia lähteitä, kuten tunnettujen instituutioiden tutkimustuloksia ja asiantuntijalausuntoja.​", navigate: "study6" },
          { value: "Käytän aihetta koskevia erilaisia tiedon ja tutkimuksen lähteitä hyödyntäen tutkimustietokantoja sekä vähemmän tunnettuja.​", navigate: "study7" },
          { value: "Kysyn aiheesta heiltä, joita asia erityisesti koskettaa.​​", navigate: "study8" },
        ]}
      />
    </div>
  );
};
